table.Comment:
Список акциий:
 pg_id - уникальный номер акции в системе P&G;
 typeid - номер типа акции(1 - pricing,2 - B&G,3 - B&G for periods,4 - B&G for volume);
 Store_type - тип торговли;
 GS - признак золотого магазина;
 description - описание акции;
 discount - скидка по акции;
 start_base,end_base - период расчета базового плана для акций типа for volume;
 growth - процент прироста планового значения для акций типа for volume;
 Budget - бюджет акции;
 compensation_type - тип компенсации(1-подарок;2-скидка;3-на выбор);
 availability - признак доступности акции по товару
 local - признак отредактированной механики(1-акция не обновляется из мастер-данных P&G)

