routine.Comment:
rexxx 04.2016

Распределение планов
PLAN_DATE  - Дата плана (1 число месяца),
SCENARIO   - Сценарий распределения:
             0 - Распределение планов по группам товара (from Plan_Clear to Plan_Group);
             1 - Распределение планов по филиалам (from Plan_Group to Plan_Filial);
             2 - Распределение планов по филиалам, KAM, KBD по значению Plan_Correct (from Plan_Fil_TMP to (Plan_Filial,plan_KBD, Plan_KAM));
             3 - Распределение по клиентам (from (Plan_filial,Plan_KBD, Plan_KAM) to Plans )
CALC       - Флаг выполнения процедуры распределения

Процедура для запуска из отчета CTrader, вносит информацию о выполнении отчета в DocLog
Использовать в каждом разделе отчета 2 раза
в "подтверждении выполнения раздела" запрос типа: {SQL select res from EPR_REPORTEXECINFO(106, 'Part1 started')}
в имени рез. файла запрос типа: {SQL select res from EPR_REPORTEXECINFO(106, 'Part1 finished')}

Базовая процедура , для получения детальной информации о продажах с детализацией входных параметров


SCENARIO = 0 то документы отбираются по полю docdate
          = 1 то документы отбираются по полю loadingdate
          = N пока не предусмотрены...

params - входящий параметр в виде структуры в JSON нотации
{
"VARIABLE_NAME_1":"VALUE"|{
                    "SQL":"QUERY TEXT"
                    /*запрос, кот. возвращает список или значение. */
                   },
"VARIABLE_NAME_2":"VALUE"|{
                    "SQL":"QUERY TEXT"
                   },
   ...
}

Переменные внутри PARAMS :
SCENARIO  =0 если не указан    -- сценарий фильтрации дат
SSET      =0 если не указан    -- разбирать наборы на составляющие
M_STORES  - обязателен         -- склады отгрузки
R_STORES  - обязателен         -- склады розницы
C_TYPES   - не обязателен      -- типы клиентов, которые исключить
M_PAYTYPES - не обязателен     -- формы оплаты
E_PAYTYPES - не обязателен     -- формы оплаты export, которые исключить

например
{
"M_STORES":"2185,2800,2802,2105",
"R_STORES":"2100,2103",
"C_TYPES":"7,25,24,23,22,32,33,34,35,36,37",
"M_PAYTYPES":"1,2,4,6,8,9,10,12",
"E_PAYTYPES":{"SQL":"select list(id) from paytype where id=30"}
}

column.Comment:
0 - подтвердить запуск с возможностью отменить или отложить выполнение;
1 - запросить параметры и вести себя как при обычном запуске отчета;
2 - не запрашивать параметры (использовать значения по умолчанию);
4 - а также не выводить сообщения, не индицировать процесс,
    не запускать просмотр, игнорировать ошибки при выполнении

Тип штрих кода:
0: без типа;
1: задание;
2: группа ячеек (AreaCells);
3: ячейка;
4: товар;
